import videoJ from "./../../img/video.mp4";
export const ItemListContainer = ({message, bye}) => {
    return(
        <div className="ItemListContainerStyle">
            <div className="titleStyle">
                <h1>Welcome to Sneakers L*VERS</h1>
                <br></br>
            
            <video width="435" height="260" autoPlay >
                <source src={videoJ} type="video/mp4"/>
                </video>
                </div>
            <div className="prodStyle">

                
                

            </div>
        </div>
    );
}
